import createMuiTheme from '@material-ui/core/styles/createMuiTheme';

const theme = createMuiTheme({
    breakpoints: {
        values: {
          iphone5: 340,
          xs: 0,
          sm: 600,
          md: 960,
          lg: 1280,
          xl: 1920,
        },
      },
    typography: {
        fontFamily: 'Montserrat',

    }
});

export default theme;
